import React from 'react'
import BACKGROUND from '../images/background.jpg'

export default class Weather2 extends React.Component {

    constructor() {
        super()
    }

    render(){
        return(
            <div className='grid-container' style={{backgroundImage:{WEATHER} } }>
                <div className='weather-info'>The City name : <span className='weather-value'>{this.props.city}</span></div>
                <div className='weather-info'>The Country is:<span className='weather-value'>{this.props.country}</span></div>
                <div className='weather-info'>The Temprature is: <span className='weather-value'>{this.props.temp}</span> </div>
                <div className='weather-info'>The Wind Speed:<span className='weather-value'>{this.props.wind}</span></div>

            </div>
        )
    }
}
